import React, { Component } from 'react';
import styled from 'styled-components';

const Wrapper = styled.div`

    background-color: #FECDD2;
    min-height: 100vh;
    min-width: 100vw;

`

const Navigation = styled.div`

    width: 1175px;
    display: flex;
margin: 0 auto;
    z-index: 100;
    justify-content: space-between
`

const Divider = styled.div`

    width: 1px;
    height: 15px;
    background-color: black;
    margin: 0 10px;

`    

const Icon = styled.div`

    background-image: url(https://s3-us-west-2.amazonaws.com/s.cdpn.io/3130484/spotify-logo.svg);
    height: 45px;
    width: 135px;
    background-size: contain;
    background-repeat: no-repeat;
    margin: 20px;


`

const Links = styled.div`

    display: flex;
    align-items:center;

    a {
        font-size: 16px;
        font-weight: 700;
        padding: 28px 17px;
        text-decoration: none;
        color: black;
    }

`

const BodyContainer = styled.div`

    padding-top: 50px;
    min-height: 100vh;
    width: 100%;
    max-width: 1200px;
    // border: 1px solid red;
    margin: 0 auto;
    display: flex;
    justify-content: center;

`

const TextContainer = styled.div`

    width: 237px;
    height: 500px;
    text-align: left;
    display: flex;
    align-items: center;
    padding: 5px 40px 5px 5px;

    h2 {
        font-size: 25px;
        line-height: 30px;
        font-weight: 700;
        margin-bottom: 10px;
    }

    p {
        font-size: 18px;
        line-height: 24px;
        margin-bottom: 15px;
    }

    a {
        text-decoration: none;
        font-weight: 700;
        letter-spacing: 3px;
        color: black;
    }

`

const RecordContainer = styled.div`

    background-color: blue;
    height: 580px;
    width: 650px;

` 

const RecordArm = styled.div`

    z-index: 20;
    background-image: url(https://s3-us-west-2.amazonaws.com/s.cdpn.io/3130484/record-arm.svg);
    height: 100%;
    width: 100%;
    background-position: right;
    background-repeat: no-repeat;

`

const Record = styled.div`

    position: absolute;
    z-index: 10;
    background-image: url(https://s3-us-west-2.amazonaws.com/s.cdpn.io/3130484/record.svg);
    height: 100%;
    width: 100%;
    background-position: center;
    background-size: contain;
    background-repeat: no-repeat;

`

class ErrorPage extends Component {

    state ={}

    render() {
        return(
            <Wrapper>
                <Navigation>
                    <Icon />
                    <Links>
                        <a href="#">Premium</a>
                        <a href="#">Help</a>
                        <a href="#">Download</a>
                        <Divider/>
                        <a href="#">Sign Up</a>
                        <a href="#">Login</a>                    
                    </Links>
                </Navigation>
                <BodyContainer>
                    <TextContainer>
                        <div>
                        <h2>404s and heartbreaks</h2>
                        <p>We couldn’t find the page you were looking for. Maybe our FAQ or Community can help?</p>
                        <a href="#">GO BACK</a>
                        </div>
                    </TextContainer>
                    <RecordContainer>
                        <RecordArm />
                        <Record />
                    </RecordContainer>
                </BodyContainer>
            </Wrapper>
        )
    }

} 

export default ErrorPage
